import React from "react";
import PropTypes from "prop-types";
import 'antd/dist/antd.css'

const Twity = ({ Component }) => {
    return (
        <>
            <div> 공통메뉴 </div>
            <Component />
        </>
    );
};

Twity.propTypes = {
    Component: PropTypes.elementType.isRequired
};

export default Twity;
